import React from "react";

const MovieForm = ({match,history}) => {
  return (
    <React.Fragment>
        <br/>
        <button className="btn btn-dark" onClick={()=>history.push("/movies")}  ><i className="fas fa-arrow-left"></i></button>
        <br/>
      <h1 className="backk">Movie Form <span className="badge-danger">{match.params.id}</span></h1>

    </React.Fragment>
  );
};

export default MovieForm;
